import { NfbCollection } from '../../Data/Data';
import "../Banner/Banner.css";

const CollectionCard = () => {
  return (
    <div>
    <div className='d-flex justify-content-between text-center mt-3 collection-cnt'>
    {NfbCollection.map((item,index) => (
        <div className=''>
            <img src={item.imgsrc} alt="" className='img-responsive w-100 collection-img'/>
            <h6 className='creator-heading'>{item.heading}</h6>
        <p className='creator-para'>{item.desc}</p>
    </div>
            
    ))
     }
    
        
    </div>
      
    </div>
  )
}

export default CollectionCard
